import React from 'react'
import Container from "@material-ui/core/Container"
import Accordion from "@material-ui/core/Accordion"
import AccordionSummary from "@material-ui/core/AccordionSummary"
import AccordionDetail from "@material-ui/core/AccordionDetails"




export const Confirmation = (data) => {
    return (
      <Container maxWidth="sm" >
          <h1>Confirmation</h1>
          <RenderAccordion summary="NameAndPhone" 
          details={[{"First name":data.firstName},
          {"Last name":data.lastName},
          {"Phone number":data.phone}
          ]}/>
      </Container>
    )
}


export const RenderAccordion = ({summary,details}) => (
    <Accordion>
        <AccordionSummary>
          {summary}
        </AccordionSummary>
        <AccordionDetail>
            <div>
             details.map((alldata,index)=> {
                 console.log(Object.keys(alldata)[0])
             })
            </div>
        </AccordionDetail>
    </Accordion>
)
